given = ''

def change_letters(given)
	case given
		when "A" then "T"
		when "T" then "A"
		when "C" then "G"
		when "G" then "C"
	end
end

def collector(given)

	given.split('').inject('') do |collector, letters|
		collector << change_letters(letters)
		collector
	end.reverse
end

puts collector(given)

